import React, { useState, useEffect } from 'react';
import { CSVLink } from 'react-csv';

function ExportData() {
    const [userData, setUserData] = useState([]);

    useEffect(() => {
        const getUserData = async () => {
            const userreq = await fetch("http://localhost:8085/api/v1/emp");
            const userres = await userreq.json();
            console.log(userres);
            setUserData(userres);
        }
        getUserData();
    }, []);
    return ( 
        <CSVLink data={userData} filename='Registration Data' className='btn btn-success mt-3'>
            Export User Data
        </CSVLink>
    )
}

export default ExportData;
